import React from 'react';
import './index.css';

const NetflixNavbar = () => {
  return (
    <nav className="netflix-navbar">
      <div className="logo">
        <img src="path/to/netflix-logo" alt="Netflix Logo" />
        Netflix
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Search" />
      </div>
      <div className="user-menu">
        <img src="path/to/profile-picture" alt="Profile" />
        User
      </div>
    </nav>
  );
};
